import searchIcon from "./../../../images/icon__COLOR_icon-color.svg";
import searchButton from "./../../../images/find.svg";
import FilterCheckbox from "../FilterCheckbox/FilterCheckbox";

const SearchForm = () => {
  return (
    <form className="searchform">
      <div className="searchform__content">
        <div className="searchform__line">
          <img className="searchform__icon" src={searchIcon} alt="Поиск"></img>
          <input
            className="searchform__input"
            type="search"
            placeholder="Фильм"
          ></input>
        </div>
        <button className="searchform__button">
          <img
            className="searchform__button-image"
            src={searchButton}
            alt=""
          ></img>
        </button>

        <FilterCheckbox />
      </div>
    </form>
  );
};

export default SearchForm;
